  

// TypeScript Version: 4.1

/**
* Computes the cube root of a single-precision floating-point number.
*
* @param x - input value
* @returns cube root
*
* @example
* var v = cbrtf( 64.0 );
* // returns 4.0
*
* @example
* var v = cbrtf( 27.0 );
* // returns 3.0
*
* @example
* var v = cbrtf( 0.0 );
* // returns 0.0
*
* @example
* var v = cbrtf( -9.0 );
* // returns ~-2.08
*
* @example
* var v = cbrtf( NaN );
* // returns NaN
*/
declare function cbrtf( x: number ): number;


// EXPORTS //

export = cbrtf;
